import React, { useState } from 'react';
import { useHistory } from 'react-router-dom';
import { Helmet } from 'react-helmet';
import Navbar8 from '../components/navbar8';
import Footer4 from '../components/footer4';
import './history.css';

const History = () => {
  const history = useHistory();
  const [isSignedIn, setIsSignedIn] = useState(false);
  const [hasScans, setHasScans] = useState(false);

  return (
    <div className="history-container">
      <Helmet>
        <title>Scan History | Superior Unique Pigeon</title>
      </Helmet>
      
      <Navbar8 
        link1="Home"
        link2="Email Input"
        link3="History"
      />

      <main className="history-content">
        {!isSignedIn ? (
          <div className="history-unsigned">
            <h2>üö® Hold Up! Secret Agent Pigeon üïµÔ∏è‚Äç‚ôÇÔ∏è</h2>
            <p>Your mission briefings are classified! Authenticate your bird identity:</p>
            <div className="history-buttons">
              <button 
                onClick={() => history.push('/signin')}
                className="thq-button-filled"
              >
                Agent Login
              </button>
              <button 
                onClick={() => history.push('/')}
                className="thq-button-outline"
              >
                Continue as Civilian Pigeon
              </button>
            </div>
          </div>
        ) : !hasScans ? (
          <div className="history-noscans">
            <h2>üì≠ Mission Report: No Data Found</h2>
            <p>Your spy pigeons haven't intercepted any emails yet!</p>
            <button 
              onClick={() => history.push('/email-input')}
              className="thq-button-filled"
            >
              Launch New Recon Mission
            </button>
          </div>
        ) : (
          <div className="history-scans">
            <h2>üïµÔ∏è‚Äç‚ôÇÔ∏è Classified Interceptions</h2>
            <div className="scan-item">
              <p><strong>Subject:</strong> "URGENT: Your nest has won 1 million worms!"</p>
              <p><strong>Verdict:</strong> PHISHING ATTEMPT (100% sure)</p>
              <p><strong>Pigeon Note:</strong> "Too many CAPS, smelled fishy"</p>
            </div>
          </div>
        )}
      </main>

      <Footer4 />
    </div>
  );
};

export default History;
